          <Link to="/search" className="btn btn-secondary btn-lg">
            <FiSearch /> Search Movies
          </Link>
        </div>

        <button 
          onClick={() => window.history.back()} 
          className="back-button"
        >
          <FiArrowLeft /> Go Back
        </button>
      </motion.div>

      {/* Decorative Elements */}
      <div className="decoration decoration-1">üé•</div>
